import { Link } from "react-router-dom";
import classes from "./Landing.module.css";

function Landing() {
  return (
    <div>
      <p>Game begins as soon as you select the game mode!</p>
      <ul>
        <Link to="/casual/6">
          <li>Casual</li>
        </Link>
        <Link to="/casual/3">
          <li>Practical</li>
        </Link>
        <Link to="/casual/7">
          <li>Masochist</li>
        </Link>
      </ul>
    </div>
  );
}

export default Landing;
